import React, { useState, useEffect } from 'react';
import styled from 'styled-components';

const Header = () => {

  const Nav = styled.nav`
    position: fixed;
    z-index: 1;
    margin: 2vw 2vw 2vw 2vw;
    display: flex;
    width: 100vw;
    height: 100px;
    border-radius: 10px;
    background-color: #453C67;

  `;

  return (
    <Nav>
      <NavLeft> 
         <BlizzardIcon />
         <PrimaryMenu>
            <WarcraftMenu>워크래프트</WarcraftMenu>
            <DiabloMenu>디아블로</DiabloMenu>
            <OverwatchMenu>오버워치</OverwatchMenu>
            <Starcraftmenu>스타크래프트</Starcraftmenu>


         </PrimaryMenu>
         </NavLeft>
      
      
      <NavRight> 
        <CompanyInfo>회사 소개</CompanyInfo>
        <Shop>상점</Shop>
        <Account>계정</Account>
        <InstallBtn />
      </NavRight>
    </Nav>
  );
};

export default Header;
